import React from 'react';
import MYtineraryLogo from './MYtineraryLogo.png'
import homeIcon from './homeIcon.png'
import Cities from './components/Cities'
import circledRightarrow from './circledRightarrow.png'

import { BrowserRouter, Route } from 'react-router-dom'
// import { Links, NavLink } from 'react-router-dom'
// import './responsivestyle.css'
export class App extends React.Component {

  render() {
    return (
      <BrowserRouter>
        <div className="App">

          <img src={MYtineraryLogo} alt="ItineraryLogo" id="itineraryLogo" />
          <h1 className="itinerarydescription">Find your perfect trip, designed by insiders who know and love their cities.</h1>
          <a href="www.google.com">
            <h1 className="itinerarydescription">Start Browsing</h1>
            <img src={circledRightarrow} alt="RightArrow" id="rightarrow" />
          </a>
          {/* <Cities /> */}
          <Route path="/Cities" component={Cities} />
          <h1 className="itinerarydescription">Want to build your own MYtinerary ?</h1>
          <div id="sign">
            <a href="www.google.com">Log in</a>
            <a href="www.google.com">Sign up</a>
          </div>
          <footer>
            <img src={homeIcon} alt="homeIcon" id="homeButton" />
          </footer>
        </div >
      </BrowserRouter >
    );
  }
}
export default App;
